import React, { Component } from 'react';
import "../App.css";
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/css/bootstrap.min.js';


export class Navbar extends Component {
    render() {
        return (
            <nav class="navbar navbar-expand-sm navbar-dark bg-dark">
                <a href="google.com" class="navbar-brand">MilansBlog</a>
                <button class="navbar-toggler" type="button" aria-expanded="false" data-bs-toggle="collapse" data-bs-target="#navbarMenu">
                    <span class="navbar-toggler-icon"></span>
                </button>
                <div class="collapse navbar-collapse" id="navbarMenu">
                    <ul class="navbar-nav ms-auto">
                        <li class="nav-item">
                            <a href="google.com" class="nav-link">Users</a>
                        </li>
                        <li class="nav-item">
                            <a href="google.com" class="nav-link">Products</a>
                        </li>
                    </ul>
                </div>
            </nav>
        )
    }
}
export default Navbar
